import React from 'react';
import Slideshow from './components/Slideshow';
import MusicComponent from './components/MusicComponent';

function LandingPage() {
  return (
    <div className="landing-page">
      <Slideshow/>
      <MusicComponent/>
    </div>
  );
}

export default LandingPage;
